import React from 'react';

const Header = () => {
    return (
        <>

            <div className='header'>
                <h3 className='header-logo'>Sofia Kung</h3>
                <div>
                    <a className="active.html" href="#intro">Intro</a>
                    <a href="#project-section">Projects</a>
                    <a href="https://drive.google.com/file/d/1CIM8A7S_goiCw_sPSHEtcWq9V7DmRCsB/view?usp=sharing">Resume</a>
                </div>
            </div>

        </>


    );


};

export default Header;
